import React from "react";
import { Card, Container } from "react-bootstrap";
import { connect } from "react-redux";

const mapStateToProps = (state) => {
  return {
    initialValues: {
      getLoggingList: state.inventorys.getLoggingList.length,
      errorLoggingList: state.inventorys.errorLoggingList,
    },
  };
};

const CounterAnalitik = (props) => {
  let CekLogging = props.getLoggingList;
  let TotalLogging = null;
  if (CekLogging == null) {
    TotalLogging = "0";
  } else {
      TotalLogging = CekLogging
  }
  return (
    <div>
      <Container>
        <Card style={{ width: "18rem" }}>
          <Card.Body className="text-center">
            <Card.Title>JUMLAH LOGGING</Card.Title>
            <Card.Text >{TotalLogging}</Card.Text>
          </Card.Body>
        </Card>
      </Container>
    </div>
  );
};

export default connect(mapStateToProps, null)(CounterAnalitik);
